import React, { useState } from "react";
import { Link } from "react-router-dom";
import "./Navbar.css";

function Navbar() {
  const [showChatbot, setShowChatbot] = useState(false);

  const handleChatbotToggle = () => {
    setShowChatbot(!showChatbot);
  };

  return (
    <nav className="navbar">
      <Link to="/" className="navbar-logo">
        <img src="/Logo.png" alt="Medi Connect Logo" className="navbar-logo-image" />
      </Link>
      <ul className="navbar-links">
        <li><Link to="/">Home</Link></li>
        <li><Link to="/#about">About</Link></li>
        <li><Link to="/services">Services</Link></li>
        <li><a href="https://esanjeevani.mohfw.gov.in/#/">Sanjeevani App</a></li>
        <li><button onClick={handleChatbotToggle} className="chatbot-button">Chatbot</button></li>
      </ul>

      {showChatbot && (

          <iframe
            src="https://cdn.botpress.cloud/webchat/v2.1/shareable.html?botId=b5b86abe-9d91-4709-8def-c664a4064617"
            style={{ position: 'absolute', bottom: 0, right: 0, width: '400px', height: '600px', border: 'none', zIndex: 9999 }}
            title="Chatbot"
          ></iframe>
      )}
    </nav>
  );
}

export default Navbar;
